import * as request from '~/utils/request'

const register = async (data) => {
    try {
        const result = await request.post('users', data)
        if(result.response.data.code === 40001){
            console.log(esult.response.data.message)
        }else if(result.response.data.code === 40001){
            console.log(esult.response.data.message)
        }
        console.log(result)
    } catch (error) {
        console.log(error);
    }
}

export default register;
